func TestNewRGBA(t *testing.T) {
	w := 10
	h := 20
	c := color.RGBA{0, 50, 100, 200}
	img := newRGBA(w, h, c)
	if !img.Bounds().Eq(image.Rect(0, 0, w, h)) {
		t.Fatalf("bad bounds")
	}
	for x := 0; x < w; x++ {
		for y := 0; y < h; y++ {
			if !reflect.DeepEqual(img.RGBAAt(x, y), c) {
				t.Fatalf("bad color at %d, %d: %#v", x, y, img.RGBAAt(x, y))
			}
		}
	}
}

