func TestPaletteKey(t *testing.T) {
	users := []string{
		"Username 1",
		"Username 2",
		"Username 3",
		"Username 4",
		"Username 5",
	}
	avatars := make(map[string]image.Image)
	for _, u := range users {
		img, err := Draw(30, []rune{[]rune(u)[0]}, &Options{PaletteKey: u})
		if err != nil {
			t.Fatalf("failed to create avatar for %s: %s", u, err)
		}
		avatars[u] = img
	}
	for _, u := range users {
		img, err := Draw(30, []rune{[]rune(u)[0]}, &Options{PaletteKey: u})
		if err != nil {
			t.Fatalf("failed to create avatar for %s: %s", u, err)
		}
		if !reflect.DeepEqual(avatars[u], img) {
			t.Fatalf("avatar mismatch for %s: %#v, %#v", u, avatars[u], img)
		}
	}
}

func compareImages(img1, img2 image.Image) float64 {
	if !img1.Bounds().Eq(img2.Bounds()) {
		return 0
	}
	total := 0
	equal := 0
	b := img1.Bounds()
	for x := b.Min.X; x < b.Max.X; x++ {
		for y := b.Min.Y; y < b.Max.Y; y++ {
			total++
			r1, g1, b1, a1 := img1.At(x, y).RGBA()
			r2, g2, b2, a2 := img2.At(x, y).RGBA()
			if r1 == r2 && g1 == g2 && b1 == b2 && a1 == a2 {
				equal++
			}
		}
	}
	return float64(equal) / float64(total)
}
